webpackJsonp([0x976b2b5b1c213800],{"./node_modules/json-loader/index.js!./.cache/json/2016-01-11-the-most-interesting-atom-packages-ive-found-so-far.json":function(e,t){e.exports={data:{markdownRemark:{html:'<p>I’ve been using <a href="https://atom.io/">Atom</a> as my primary text editor for the last 3 months.  I don’t completely love it.  There are elements (startup speed, maturity of some core editing components, not being able to run it in a terminal) that I miss from my experiences with Vim and/or Sublime Text.  I’m using Atom though because the core editing experience is now “good enough” and the way the editor is built allows for some very cool and unique experiences.  Atom (like <a href="https://code.visualstudio.com/">Visual Studio Code</a>) is built on <a href="http://electron.atom.io/">Electron</a>, Github’s JavaScript environment for building desktop apps.  Because it is built with web technologies and was designed from the beginning to be extensible, it is much easier for most developers to build rich visual extensions on top of Atom that provide unique UIs for editor functions than it is in Sublime Text, Vim, Emacs or an IDE.  The following are some of the “most interesting” Atom packages I’ve found.  Interesting in this case means that they really only could have been done as they are in Atom or a similarly flexible editor.</p>\n<h3>Pigments</h3>\n<p>At first use, <a href="https://github.com/abe33/atom-pigments">Pigments</a> seems like a pretty run of the mill color highlighter.  There are similar projects for Sublime Text and Vim that look at color names in a CSS or LESS file and highlight them with the color they represent.</p>\n<html><head></head><body>\n  <a class="gatsby-resp-image-link" href="undefined" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; z-index: -1; display: block; ">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 108.77914951989027%;position: relative; width: 100%; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="pigment-preview" title="" src="/static/1066e190f183df795921a746101a2b1a-d766e.png" srcset="/static/1066e190f183df795921a746101a2b1a-a6b6e.png 143w,\n/static/1066e190f183df795921a746101a2b1a-8e488.png 285w,\n/static/1066e190f183df795921a746101a2b1a-d766e.png 570w,\n/static/1066e190f183df795921a746101a2b1a-13239.png 855w,\n/static/1066e190f183df795921a746101a2b1a-cab6d.png 1140w,\n/static/1066e190f183df795921a746101a2b1a-74753.png 1458w" sizes="(max-width: 570px) 100vw, 570px">\n    </span>\n  </span>\n  \n  </a>\n    </body></html>\n<p>But Pigments does much more than that.  In addition to highlighting text, Pigments searches your project and creates a directory of all the colors used in your projects.  You can look through your palette and quickly go to the definition of any individual color.  Because pigments tracks everything, it can highlight LESS/SCSS variables as well as plain color names, even if those variables were originally defined in a different file.  Pigments also hooks into Atom’s autocomplete, and displays a preview of the color options when autofilling colors.</p>\n<html><head></head><body>\n  <a class="gatsby-resp-image-link" href="undefined" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; z-index: -1; display: block; ">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 78.69934024505183%;position: relative; width: 100%; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Pigments project" title="" src="/static/d326da676a7c3fa39fdfb5e3a74b8139-d766e.png" srcset="/static/d326da676a7c3fa39fdfb5e3a74b8139-a6b6e.png 143w,\n/static/d326da676a7c3fa39fdfb5e3a74b8139-8e488.png 285w,\n/static/d326da676a7c3fa39fdfb5e3a74b8139-d766e.png 570w,\n/static/d326da676a7c3fa39fdfb5e3a74b8139-13239.png 855w,\n/static/d326da676a7c3fa39fdfb5e3a74b8139-cab6d.png 1140w,\n/static/d326da676a7c3fa39fdfb5e3a74b8139-71f14.png 1710w,\n/static/d326da676a7c3fa39fdfb5e3a74b8139-4e85e.png 2122w" sizes="(max-width: 570px) 100vw, 570px">\n    </span>\n  </span>\n  \n  </a>\n    </body></html>\n<p>It is a rich way of managing colors for a whole project, the best way of seeing at a glance every color used in your CSS project that I’ve ever seen.</p>\n<h3>Expose</h3>\n<p><a href="https://atom.io/packages/expose">Expose</a> is a file management tool modeled after Mac OSX’s expose feature.  With it, you can instantly display all open files as small thumbnails, and switch quickly between them using the keyboard, which can be super helpful when tabs get out of control.</p>\n<html><head></head><body>\n  <a class="gatsby-resp-image-link" href="undefined" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; z-index: -1; display: block; ">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 63.70656370656371%;position: relative; width: 100%; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="expose" title="" src="/static/d1798289fa4b4e0d16d1da2ca8d1b999-d766e.png" srcset="/static/d1798289fa4b4e0d16d1da2ca8d1b999-a6b6e.png 143w,\n/static/d1798289fa4b4e0d16d1da2ca8d1b999-8e488.png 285w,\n/static/d1798289fa4b4e0d16d1da2ca8d1b999-d766e.png 570w,\n/static/d1798289fa4b4e0d16d1da2ca8d1b999-13239.png 855w,\n/static/d1798289fa4b4e0d16d1da2ca8d1b999-cab6d.png 1140w,\n/static/d1798289fa4b4e0d16d1da2ca8d1b999-71f14.png 1710w,\n/static/d1798289fa4b4e0d16d1da2ca8d1b999-5816d.png 2072w" sizes="(max-width: 570px) 100vw, 570px">\n    </span>\n  </span>\n  \n  </a>\n    </body></html>\n<h3>Autocomplete-plus</h3>\n<p><a href="https://github.com/atom/autocomplete-plus/">Autocomplete-plus</a> started as a community package but has now become part of the core editor.  It’s also probably the least unique idea I’m listing here.  It’s still worth including on this list though, for 2 reasons.  First, autocomplete plus has flexible visual context options, allowing autocomplete providers to show the type of the autocomplete option, a brief description, and potentially a more in depth description.  So users can distinguish between (for instance) completions offering a snippet, a function, a keyword, or an import.</p>\n<html><head></head><body>\n  <a class="gatsby-resp-image-link" href="undefined" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; z-index: -1; display: block; ">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 66.07629427792916%;position: relative; width: 100%; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="autocomplete-plus" title="" src="/static/f7bd823fd1cf6230818b867937150556-d766e.png" srcset="/static/f7bd823fd1cf6230818b867937150556-a6b6e.png 143w,\n/static/f7bd823fd1cf6230818b867937150556-8e488.png 285w,\n/static/f7bd823fd1cf6230818b867937150556-d766e.png 570w,\n/static/f7bd823fd1cf6230818b867937150556-13239.png 855w,\n/static/f7bd823fd1cf6230818b867937150556-cab6d.png 1140w,\n/static/f7bd823fd1cf6230818b867937150556-11221.png 1468w" sizes="(max-width: 570px) 100vw, 570px">\n    </span>\n  </span>\n  \n  </a>\n    </body></html>\n<p>Autocomplete-plus is also a great example of the flexible nature of Atom.  Because Atom itself is made up of packages, with a very small core package, it’s easy to replace key parts of the editor like the auto-complete package with a community version.  And if that version ends up being better in the long run, it’s possible to pull that into the editors core, as happened with autocomplete-plus.</p>\n<h3>Todo-show</h3>\n<p><a href="https://atom.io/packages/todo-show">Todo-show</a> is a cool little package that searches your project for comments containing TODO, FIXME, CHANGED, REVIEW and other configurable comment strings, and lists them as a table.  It’s a simple idea that formalizes something that many developers do all the time.</p>\n<html><head></head><body>\n  <a class="gatsby-resp-image-link" href="undefined" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; z-index: -1; display: block; ">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 74.18546365914787%;position: relative; width: 100%; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="todo-show" title="" src="/static/c96256111971e5c0d8ceac160ec20b8a-d766e.png" srcset="/static/c96256111971e5c0d8ceac160ec20b8a-a6b6e.png 143w,\n/static/c96256111971e5c0d8ceac160ec20b8a-8e488.png 285w,\n/static/c96256111971e5c0d8ceac160ec20b8a-d766e.png 570w,\n/static/c96256111971e5c0d8ceac160ec20b8a-13239.png 855w,\n/static/c96256111971e5c0d8ceac160ec20b8a-cab6d.png 1140w,\n/static/c96256111971e5c0d8ceac160ec20b8a-0e39a.png 1596w" sizes="(max-width: 570px) 100vw, 570px">\n    </span>\n  </span>\n  \n  </a>\n    </body></html>\n<p><strong>Update</strong>:  Twitter has pointed out this even crazier riff on this concept that I’d seen a while ago but had been unable to find when I dove back into Atom.  <a href="http://imdone.io/">Imdone</a> is a trello-like experience in the editor for managing todos.</p>\n<blockquote class="twitter-tweet" lang="en"><p lang="en" dir="ltr"><a href="https://twitter.com/ben336">@ben336</a> <a href="https://twitter.com/AtomEditor">@AtomEditor</a> You might also like imdone-atom. It&#39;s a drag and drop TODO task board with issue tracking integration!</p>&mdash; imdone.io (@imdoneIO) <a href="https://twitter.com/imdoneIO/status/686577997395013633">January 11, 2016</a></blockquote>\n<h3>Linter</h3>\n<p>Similar to autocomplete-plus, you may think you’ve seen <a href="https://atom.io/packages/linter">Linter</a> before.  It’s similar to Syntastic for Vim and SublimeLinter for Sublime Text.  But Atom’s flexibility allows it to be better than both of those.  Like Syntastic and SublimeLinter, Linter integrates with many different linting providers to show errors and warnings that tools pick up on through static analysis in files.  But rather than being limited to the line-by-line gutter warnings or showing collections of warnings through awkward use of UI elements meant for a different purpose, Linter shows you a live collection of errors at the bottom of the file and lets you easily switch back and forth between that and errors for all open project files.</p>\n<html><head></head><body>\n  <a class="gatsby-resp-image-link" href="undefined" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; z-index: -1; display: block; ">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 97.26027397260275%;position: relative; width: 100%; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="linter" title="" src="/static/ba4861e9f9ce9f39bd0f22721ff78fc4-d766e.png" srcset="/static/ba4861e9f9ce9f39bd0f22721ff78fc4-a6b6e.png 143w,\n/static/ba4861e9f9ce9f39bd0f22721ff78fc4-8e488.png 285w,\n/static/ba4861e9f9ce9f39bd0f22721ff78fc4-d766e.png 570w,\n/static/ba4861e9f9ce9f39bd0f22721ff78fc4-13239.png 855w,\n/static/ba4861e9f9ce9f39bd0f22721ff78fc4-cab6d.png 1140w,\n/static/ba4861e9f9ce9f39bd0f22721ff78fc4-4d321.png 1606w" sizes="(max-width: 570px) 100vw, 570px">\n    </span>\n  </span>\n  \n  </a>\n    </body></html>\n<h3>git-time-machine</h3>\n<p><a href="https://github.com/littlebee/git-time-machine">git-time-machine</a> is the newest package on this list.  It’s only a month old, but is quite possibly my favorite example of Atom’s potential.  After setting it up, you can use a keyboard shortcut to see a bubble plot of that files git history, and then hover to see the commit messages, and click to see an old version of the file.  It is the most accessible UI I’ve ever seen for working with git history.</p>\n<html><head></head><body>\n  <a class="gatsby-resp-image-link" href="undefined" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; z-index: -1; display: block; ">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 71.88470066518848%;position: relative; width: 100%; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="time-machine" title="" src="/static/7b631aba368f4d4c7492322776700abc-d766e.png" srcset="/static/7b631aba368f4d4c7492322776700abc-a6b6e.png 143w,\n/static/7b631aba368f4d4c7492322776700abc-8e488.png 285w,\n/static/7b631aba368f4d4c7492322776700abc-d766e.png 570w,\n/static/7b631aba368f4d4c7492322776700abc-13239.png 855w,\n/static/7b631aba368f4d4c7492322776700abc-cab6d.png 1140w,\n/static/7b631aba368f4d4c7492322776700abc-71f14.png 1710w,\n/static/7b631aba368f4d4c7492322776700abc-7aaba.png 2255w" sizes="(max-width: 570px) 100vw, 570px">\n    </span>\n  </span>\n  \n  </a>\n    </body></html>',frontmatter:{title:"The Most Interesting Atom Packages I've found (so far)",keywords:null,category:"tools",date:"2016-01-11 02:25:49+00:00",path:"/2016/01/11/the-most-interesting-atom-packages-ive-found-so-far",layout:"post",hideFooter:null}}},pathContext:{slug:"/2016/01/11/the-most-interesting-atom-packages-ive-found-so-far",relatedPosts:[{title:"Learning Vim in 2014",path:"/learning-vim-in-2014",description:"A series of beginner level articles on Vim"},{title:"Atom Productivity Tips",path:"/2017/05/29/atom-tips/",description:"Getting the most out of Atom"},{title:"Mariana Syntax Theme For Atom",path:"/2017/05/28/mariana-syntax-atom/",description:"Announcing a port of the Mariana color scheme to Atom"}]}}}});
